import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    height: 76,
    width: 76,
    margin: 7,
    borderRadius: 40,
    borderWidth: 3,
    borderColor: "#ae22e0",
  },
  image: {
    height: 80,
    width: 80,
    borderRadius: 40,
    borderWidth: 1,
    borderColor: "#fff",

  }
});

export default styles;
